import React from 'react';

const MsgPanel = ({ closePanel }) => {
    return (
        <div className='msg-panel'>
            <article className="panel is-info">
                <button className="panel-close delete is-pulled-right has-text-info msg-cloes-btn" onClick={closePanel}>

                    {/* <i className="fas fa-times"></i> */}
                </button>
                <p className="panel-heading">Info</p>
                <p className="panel-tabs">
                    <a className="is-active">All</a>
                    {/* <a>Public</a>
                    <a>Private</a>
                    <a>Sources</a>
                    <a>Forks</a> */}
                </p>
                <div className="panel-block customer-panel-msg">
                    <div className="msg-panel-body">
                        <textarea className="input"></textarea>
                        <p className="control has-icons-left">
                            <input className="input is-info" type="text" placeholder="Search" />
                            <span className="icon is-left">
                                <i className="fas fa-search" aria-hidden="true"></i>
                            </span>
                        </p>
                    </div>
                </div>
            </article>
        </div>
    );
};

export default MsgPanel;
